const Home = () => {
  const [pageNumber, setPageNumber] = useState(1);

  
  return (
    <div>
      <section className="grid md:grid-cols-12">
        {/*==================== Side navbar section ======================*/}
        <div className="hidden lg:block min-h-screen col-span-2">
          <h1 className="text-blue-600 text-center text-4xl font-serif font-thin my-10">
            LOGO
          </h1>

          <div>
            {routers?.map((router) => (
              <div key={router?.index}>
                {router?.index === 6 && <hr className="mx-4" />}
                <div
                  className={`${
                    pageNumber === router?.index &&
                    "bg-blue-200 border-l-4 border-l-blue-600"
                  } py-4 pl-6 cursor-pointer hover:bg-blue-200`}
                >
                  {router.name}
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* -------------------------Main body--------------------------- */}
        <div className="min-h-screen md:col-span-12 lg:col-span-10 bg-gray-200">
          {/*========================== Navbar section ==================*/}
          <Navbar />

          {/* ========================small banner================== */}
          <SmallBanner />

          {/* ======================= Carousle ==========================*/}
          <Carousle />


          {/* ========================featuerd & Popular site ======== */}
          <FeaturesAndPopularSite />
        </div>
      </section>
    </div>
  );
};

export default Home;
